import React from "react";
import classes from "./PokemonInformation.module.css";
const pokemonInformation = props => (
  <div className={classes.PokemonInformation}>
    <h3 className={classes.Row}>{props.pokemonName}</h3>
    <div>
      <img className={classes.Row} />
      <p className={classes.Row}>Dex #{props.pokemonNumber}</p>
    </div>

    <div className={classes.Border}>
      <p>Type</p>
      <p>Weight</p>
      <p>Height</p>
    </div>
  </div>
);

export default pokemonInformation;
